import React from 'react';
import { connect } from 'react-redux';
import requiresLogin from './requires-login';
import './dashboard.css';

import { Link } from 'react-router-dom';

export class Dashboard extends React.Component {
  render() {
    return (
      // entire dashboard
      <div className="dashboard-layout">
        {/* top part of dashboard */}
        <div className="dashboard-top">
          {/* top bar of dashboard */}
                <div className="dashboard-background">
          <div className="dashboard-banner">
            <div className="welcome-message-prompt">
              <div className="left-banner">Welcome: {this.props.username}</div>
              <div className="right-banner">
                <p>Stat 1: </p>
                <p>Stat 1: </p>
                <p>Stat 1: </p>
              </div>
            </div>
          </div>
          </div>
          {/* End of top bar of dashboard */}
          <div className="dashboard-main">
            <div className="dashboard-box">
              <div className="title">
                <h1>SQL LEARING LABS : BASIC</h1>
              </div>
              <div className="about-cards">
                SQL Learning Labs is a platform made to test your knowledge of
                SQL Bash commands, and to help you accelerate your learning.
                Click below to get started.
              </div>
                        <div className="dashboard-name">
                            Let's get started: {this.props.name}
                        </div>
                        <Link to="/frontofcard">
                            <button>SQL Basics</button>
                        </Link>
            </div>
                    <div className="dashboard-box">
                        <div className="title">
                            <h1>SQL LEARING LABS : BASIC</h1>
                        </div>
                        <div className="about-cards">
                            SQL Learning Labs is a platform made to test your knowledge of
                            SQL Bash commands, and to help you accelerate your learning.
                            Click below to get started.
              </div>
                        <div className="dashboard-name">
                            Let's get started: {this.props.name}
                        </div>
                        <Link to="/frontofcard">
                            <button>SQL Basics</button>
                        </Link>
                    </div>
          </div>
        </div>





      </div>
    );
  }
}

const mapStateToProps = state => {
  const { currentUser } = state.authReducer;
  return {
    username: state.authReducer.currentUser.username,
    name: `${currentUser.firstName} ${currentUser.lastName}`
  };
};

export default requiresLogin()(connect(mapStateToProps)(Dashboard));


